import React, { Component } from 'react';
import { Card, ListGroup, ListGroupItem, Button } from 'react-bootstrap';

import BookNowBtn from '../testers/BookNowBtn';


export default class CabinCardIndy extends Component {
  constructor(props) {
    super(props)
  }

  render() {
    return (
      <div>
          <Card style={{ width: '18rem' }}>
            <Card.Img variant="top" src={this.props.cabin.thumbnailURL} height={'350'}/>
            <Card.Body>
              <Card.Title>{this.props.cabin.name}</Card.Title>
              <Card.Text>{this.props.cabin.location} Area</Card.Text>
              <Card.Text>${this.props.cabin.price} /night</Card.Text>
              <Card.Text>
                Some quick example text to build on the card title and make up the bulk of
                the card's content.
              </Card.Text>
            </Card.Body>
            <ListGroup className="list-group-flush">
              <ListGroupItem>Activities: {this.props.cabin.activities_1}, {this.props.cabin.activities_2}, {this.props.cabin.activities_3} </ListGroupItem>
              <ListGroupItem>Dapibus ac facilisis in</ListGroupItem>
              <ListGroupItem>Vestibulum at eros</ListGroupItem>
            </ListGroup>
            <Card.Body>
            <>
                        <style type="text/css">
                        {`
                        .btn-learn {
                            background-color: white;
														color: #00A388;
														border: 1px solid #00A388;
                        }
                        `}
                        </style>
                    <BookNowBtn />
                    <Button href='./cabin-demo' variant="learn" >
                        Learn More
                    </Button>
              </>
            </Card.Body>
          </Card>
      </div>
    )
  }
}
